class Solution {
public:
    bool isSubsequence(string s, string t) {
  if(t=="")return true;
        unordered_map<char,int>m,x;
        int n2=t.size();
        for(int i=0;i<n2;i++){
            m[t[i]]=i+1;
            x[t[i]]++;
        }
        int n=s.size();
        for(int i=0;i<n;i++){
            if(!m.count(s[i]))return false;
                        if(i+1<n && m[s[i]]>m[s[i+1]])return false;

            x[s[i]]--;
            if(x[s[i]]==0){x.erase(s[i]);
                           m.erase(s[i]);}
        }
        return true;
    }
};